import React, { Component } from 'react';
import { users, addUser } from '../../model/store';
import io from 'socket.io-client';

class App extends Component {

  style = {
    textAlign: 'center'
  }

  nav = () => {

  }

  socket = io("ws://localhost:1000", 'sock');

  render() {
    return (
      <div style={this.style}>
        <h1>App component</h1>
        {users.map(user =>
          <div>
            <span>{user.name}</span>
            <span>{user.lastname}</span>
          </div>)
        }
        <button onClick={() => addUser({ name: 'fromApp', lastname: 'lastnameApp' })}>add</button>
        <button onClick={() => this.props.history.push("2")}>route</button>
      </div>
    );
  }
}

export default App;
